import React, { useEffect } from "react";
import { Link, useLocation } from "react-router-dom";
import '../../styles/result.css'
import Charizard from '../../assets/charizard.png'

function ResultPage(){
    const saveLocalStorage = () => {
        var storedSave = JSON.parse(localStorage.getItem("Trader"))
        var string = "";
        if(storedSave !=null){
            var Trader = [];
            storedSave.map((item) => {
                return Trader.push({
                    pokemon:[
                        string.concat(item.quantity, " "),
                        string.concat(item.pokemon.name, "  "),
                        string.concat(item.pokemon.experience, "  "),
                    ]
                })
            })
        }
        return console.log(Trader.pokemon)
    }

    return(
        <div className="ResultGlobalContent">
            <div className="ResultTextButton">
                <div className="ResultTextContent">
                    troca boa ein
                </div>
                <div className="ResultButtonJogar">
                    <Link 
                        style={{ textDecoration: "none" }} 
                        to={{ pathname: "/" }}
                    >
                        <button className="ButtonResult">
                            Jogar novamente
                        </button>
                    </Link>

                </div>
            </div> 
            <div className="ResultImg">
                <img alt="Charizard pokemon" src={Charizard} onClick={saveLocalStorage }/>
            </div>
        </div>
    )
}

export default ResultPage;
